import React from 'react';
import './Banner.css';
import BannerCarousel from './BannerCarousel';

const Banner = () => {
    return (
        <div className="banner">
            <img src={require('../../assets/images/one6.jpg')} alt="banner" className="banner-image" />
            <div className="banner-content">
                <h1>Discover the <span className='highlight'>Beauty of Uttarakhand</span> with Travel_Uttarakhand</h1>
                <p>
                    Your Gateway to Adventure in the <span className='highlight2'>Land of Gods</span>
                </p>
        <section className="banner">
            <BannerCarousel />
        </section>
            </div>
        </div>
    );
};

export default Banner;
